import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './style.css';

// Halak listája
const HalakList = () => {
    const [halak, setHalak] = useState([]);

    useEffect(() => {
        axios.get('https://localhost:7129/api/Halak/halak')
            .then((response) => {
                setHalak(response.data);
            })
            .catch((error) => {
                console.error('Error fetching halak:', error);
            });
    }, []);

    const handleEdit = (id, field, value) => {
        const updatedHalak = halak.map((hal) =>
            hal.id === id ? { ...hal, [field]: value } : hal
        );
        setHalak(updatedHalak);

        // Update the backend with the new value
        axios.put(`https://localhost:7129/api/Halak/halak/${id}`, { ...updatedHalak.find(hal => hal.id === id) })
            .catch((error) => {
                console.error('Error updating halak:', error);
            });
    };

    return (
        <div className="card">
            <h3 className="card-title">Halak</h3>
            <table className="table">
                <thead>
                    <tr>
                        <th>Hal neve</th>
                        <th>Tó neve</th>
                    </tr>
                </thead>
                <tbody>
                    {halak.map((hal) => (
                        <tr key={hal.id}>
                            <td
                                contentEditable
                                onBlur={(e) => handleEdit(hal.id, 'nev', e.target.textContent)}
                            >
                                {hal.nev}
                            </td>
                            <td
                                contentEditable
                                onBlur={(e) => handleEdit(hal.id, 'toNev', e.target.textContent)}
                            >
                                {hal.toNev}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

// Fogasok listája
const FogasokList = () => {
    const [fogasok, setFogasok] = useState([]);

    useEffect(() => {
        axios.get('https://localhost:7129/api/Halak/fogasok')
            .then((response) => {
                setFogasok(response.data);
            })
            .catch((error) => {
                console.error('Error fetching fogasok:', error);
            });
    }, []);

    const handleEdit = (index, field, value) => {
        const updatedFogasok = [...fogasok];
        updatedFogasok[index][field] = value;
        setFogasok(updatedFogasok);

        // Update the backend with the new value
        axios.put(`https://localhost:7129/api/Halak/fogasok/${fogasok[index].id}`, updatedFogasok[index])
            .catch((error) => {
                console.error('Error updating fogasok:', error);
            });
    };

    return (
        <div className="card">
            <h3 className="card-title">Fogások</h3>
            <table className="table">
                <thead>
                    <tr>
                        <th>Horgász neve</th>
                        <th>Hal neve</th>
                        <th>Dátum</th>
                    </tr>
                </thead>
                <tbody>
                    {fogasok.map((fogas, index) => (
                        <tr key={index}>
                            <td
                                contentEditable
                                onBlur={(e) => handleEdit(index, 'horgaszNev', e.target.textContent)}
                            >
                                {fogas.horgaszNev}
                            </td>
                            <td
                                contentEditable
                                onBlur={(e) => handleEdit(index, 'halNev', e.target.textContent)}
                            >
                                {fogas.halNev}
                            </td>
                            <td
                                contentEditable
                                onBlur={(e) => handleEdit(index, 'datum', e.target.textContent)}
                            >
                                {fogas.datum}
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

// Top 3 Halak listája
const Top3Hal = () => {
    const [topHalak, setTopHalak] = useState([]);

    useEffect(() => {
        axios.get('https://localhost:7129/api/Halak/top3hal')
            .then((response) => {
                setTopHalak(response.data);
            })
            .catch((error) => {
                console.error('Error fetching top halak:', error);
            });
    }, []);

    return (
        <div className="card">
            <h3 className="card-title">A 3 legnagyobb hal</h3>
            <table className="table">
                <thead>
                    <tr>
                        <th>Hal neve</th>
                        <th>Méret (cm)</th>
                    </tr>
                </thead>
                <tbody>
                    {topHalak.map((hal, index) => (
                        <tr key={index}>
                            <td>{hal.nev}</td>
                            <td>{hal.meretCm}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const App = () => {
    return (
        <div className="app-container">
            <HalakList />
            <FogasokList />
            <Top3Hal />
        </div>
    );
};

export default App;
